   // HTML data-da="where(uniq class name),position(digi),when(breakpoint)"
   // e.x. data-da="item,2,992"
   ;(function () {
      let originalPositions = []
      let daElements = document.querySelectorAll("[data-da]")
      let daElementsArray = []
      let daMatchMedia = []
      //Ð—Ð°Ð¿Ð¾Ð»Ð½ÑÐµÐ¼ Ð¼Ð°ÑÑÐ¸Ð²Ñ‹
      if (daElements.length > 0) {
         let number = 0
         for (let index = 0; index < daElements.length; index++) {
            const daElement = daElements[index]
            const daMove = daElement.getAttribute("data-da")
            if (daMove != "") {
               const daArray = daMove.split(",")
               const daPlace = daArray[1] ? daArray[1].trim() : "last"
               const daBreakpoint = daArray[2] ? daArray[2].trim() : "767"
               const daType = daArray[3] === "min" ? daArray[3].trim() : "max"
               const daDestination = document.querySelector(
                  "." + daArray[0].trim()
               )
               if (daArray.length > 0 && daDestination) {
                  daElement.setAttribute("data-da-index", number)
                  //Ð—Ð°Ð¿Ð¾Ð»Ð½ÑÐµÐ¼ Ð¼Ð°ÑÑÐ¸Ð² Ð¿ÐµÑ€Ð²Ð¾Ð½Ð°Ñ‡Ð°Ð»ÑŒÐ½Ñ‹Ñ… Ð¿Ð¾Ð·Ð¸Ñ†Ð¸Ð¹
                  originalPositions[number] = {
                     parent: daElement.parentNode,
                     index: indexInParent(daElement),
                  }
                  //Ð—Ð°Ð¿Ð¾Ð»Ð½ÑÐµÐ¼ Ð¼Ð°ÑÑÐ¸Ð² ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚Ð¾Ð²
                  daElementsArray[number] = {
                     element: daElement,
                     destination: document.querySelector(
                        "." + daArray[0].trim()
                     ),
                     place: daPlace,
                     breakpoint: daBreakpoint,
                     type: daType,
                  }
                  number++
               }
            }
         }
         dynamicAdaptSort(daElementsArray)

         //Ð¡Ð¾Ð·Ð´Ð°ÐµÐ¼ ÑÐ¾Ð±Ñ‹Ñ‚Ð¸Ñ Ð² Ñ‚Ð¾Ñ‡ÐºÐµ Ð±Ñ€ÐµÐ¹ÐºÐ¿Ð¾Ð¸Ð½Ñ‚Ð°
         for (let index = 0; index < daElementsArray.length; index++) {
            const el = daElementsArray[index]
            const daBreakpoint = el.breakpoint
            const daType = el.type

            daMatchMedia.push(
               window.matchMedia(
                  "(" + daType + "-width: " + daBreakpoint + "px)"
               )
            )
            daMatchMedia[index].addListener(dynamicAdapt)
         }
      }
      //ÐžÑÐ½Ð¾Ð²Ð½Ð°Ñ Ñ„ÑƒÐ½ÐºÑ†Ð¸Ñ
      function dynamicAdapt(e) {
         for (let index = 0; index < daElementsArray.length; index++) {
            const el = daElementsArray[index]
            const daElement = el.element
            const daDestination = el.destination
            const daPlace = el.place
            const daBreakpoint = el.breakpoint
            const daClassname = "_dynamic_adapt_" + daBreakpoint

            if (daMatchMedia[index].matches) {
               //ÐŸÐµÑ€ÐµÐ±Ñ€Ð°ÑÑ‹Ð²Ð°ÐµÐ¼ ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚Ñ‹
               if (!daElement.classList.contains(daClassname)) {
                  let actualIndex = indexOfElements(daDestination)[daPlace]
                  if (daPlace === "first") {
                     actualIndex = indexOfElements(daDestination)[0]
                  } else if (daPlace === "last") {
                     actualIndex = indexOfElements(daDestination)[
                        indexOfElements(daDestination).length
                     ]
                  }
                  daDestination.insertBefore(
                     daElement,
                     daDestination.children[actualIndex]
                  )
                  daElement.classList.add(daClassname)
               }
            } else {
               //Ð’Ð¾Ð·Ð²Ñ€Ð°Ñ‰Ð°ÐµÐ¼ Ð½Ð° Ð¼ÐµÑÑ‚Ð¾
               if (daElement.classList.contains(daClassname)) {
                  dynamicAdaptBack(daElement)
                  daElement.classList.remove(daClassname)
               }
            }
         }
         customAdapt()
      }

      //Ð’Ñ‹Ð·Ð¾Ð² Ð¾ÑÐ½Ð¾Ð²Ð½Ð¾Ð¹ Ñ„ÑƒÐ½ÐºÑ†Ð¸Ð¸
      dynamicAdapt()

      //Ð¤ÑƒÐ½ÐºÑ†Ð¸Ñ Ð²Ð¾Ð·Ð²Ñ€Ð°Ñ‚Ð° Ð½Ð° Ð¼ÐµÑÑ‚Ð¾
      function dynamicAdaptBack(el) {
         const daIndex = el.getAttribute("data-da-index")
         const originalPlace = originalPositions[daIndex]
         const parentPlace = originalPlace["parent"]
         const indexPlace = originalPlace["index"]
         const actualIndex = indexOfElements(parentPlace, true)[indexPlace]
         parentPlace.insertBefore(el, parentPlace.children[actualIndex])
      }
      //Ð¤ÑƒÐ½ÐºÑ†Ð¸Ñ Ð¿Ð¾Ð»ÑƒÑ‡ÐµÐ½Ð¸Ñ Ð¸Ð½Ð´ÐµÐºÑÐ° Ð²Ð½ÑƒÑ‚Ñ€Ð¸ Ñ€Ð¾Ð´Ð¸Ñ‚ÐµÐ»Ñ
      function indexInParent(el) {
         var children = Array.prototype.slice.call(el.parentNode.children)
         return children.indexOf(el)
      }
      //Ð¤ÑƒÐ½ÐºÑ†Ð¸Ñ Ð¿Ð¾Ð»ÑƒÑ‡ÐµÐ½Ð¸Ñ Ð¼Ð°ÑÑÐ¸Ð²Ð° Ð¸Ð½Ð´ÐµÐºÑÐ¾Ð² ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚Ð¾Ð² Ð²Ð½ÑƒÑ‚Ñ€Ð¸ Ñ€Ð¾Ð´Ð¸Ñ‚ÐµÐ»Ñ
      function indexOfElements(parent, back) {
         const children = parent.children
         const childrenArray = []
         for (let i = 0; i < children.length; i++) {
            const childrenElement = children[i]
            if (back) {
               childrenArray.push(i)
            } else {
               //Ð˜ÑÐºÐ»ÑŽÑ‡Ð°Ñ Ð¿ÐµÑ€ÐµÐ½ÐµÑÐµÐ½Ð½Ñ‹Ð¹ ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚
               if (childrenElement.getAttribute("data-da") == null) {
                  childrenArray.push(i)
               }
            }
         }
         return childrenArray
      }
      //Ð¡Ð¾Ñ€Ñ‚Ð¸Ñ€Ð¾Ð²ÐºÐ° Ð¾Ð±ÑŠÐµÐºÑ‚Ð°
      function dynamicAdaptSort(arr) {
         arr.sort(function (a, b) {
            if (a.breakpoint > b.breakpoint) {
               return -1
            } else {
               return 1
            }
         })
         arr.sort(function (a, b) {
            if (a.place > b.place) {
               return 1
            } else {
               return -1
            }
         })
      }
      //Ð”Ð¾Ð¿Ð¾Ð»Ð½Ð¸Ñ‚ÐµÐ»ÑŒÐ½Ñ‹Ðµ ÑÑ†ÐµÐ½Ð°Ñ€Ð¸Ð¸ Ð°Ð´Ð°Ð¿Ñ‚Ð°Ñ†Ð¸Ð¸
      function customAdapt() {
         //const viewport_width = Math.max(document.documentElement.clientWidth, window.innerWidth || 0);
      }
	})()

   let constructorItems = document.querySelectorAll(
      ".item-constructor__checkbox"
   )

   constructorItems.forEach(function (item) {
      item.addEventListener("change", function (e) {
         let sumBlock = item
				.closest(".constructor")
				? item.closest(".constructor").querySelector(".constructor__sum")
				? item.closest(".constructor").querySelector(".constructor__sum")
				: false
				: false
         if (sumBlock) {
            let oldSum = parseFloat(sumBlock.textContent)
            let newSum = item.checked
               ? oldSum + +item.closest(".item-constructor").dataset.price
               : oldSum - +item.closest(".item-constructor").dataset.price
            let word
            switch (newSum) {
               case 1:
                  word = "Ñ€ÑƒÐ±Ð»ÑŒ"
                  break
               case 2:
               case 3:
               case 4:
                  word = "Ñ€ÑƒÐ±Ð»Ñ"
                  break
               default:
                  word = "Ñ€ÑƒÐ±Ð»ÐµÐ¹"
                  break
            }
				sumBlock.textContent = `${newSum} ${word}`
			}
      })
	})

